import * as types from './types'

// export const setForm = () => {
//     return {
//         type: types.SET_SUGGEST_FORM
//     }
// }

export const clearForm = () => {
    return {
        type: types.CLEAR_SUGGEST_FORM
    }
}

export const makeSuggest = (data) => {
    return {
        type: types.MAKE_SUGGEST,
        payload: data,
        meta: {
            async: true,
            blocking: true,
            path: `/suggest`,
            method: "POST",
            body: data
        }
    }
}
